    static double SumProduct(double[] array, double[] weights, 
        int arrayStartIndex, int weightsStartIndex, int count)
    {
        double sum = 0;
        for (int k = 0; k < count; k++)
        {
            sum += array[arrayStartIndex + k] * weights[weightsStartIndex + k];
        }
        return sum;
    }
    
    
    private static double[] NormalizeData(IEnumerable<double> data, double min, double max)
    {
        double dataMax = data.Max();
        double dataMin = data.Min();
        double range = dataMax - dataMin;

        return data
            .Select(d => (d - dataMin) / range)  // Normalize to [0, 1]
            .Select(n => (1 - n) * min + n * max)  // Scale to [min, max]
            .Select(n =>
            {
                if (n >= 0.95)
                    return 1.0;
                if (n <= 0.05)
                    return 0.0;
                return n;
            })
            .ToArray();
    }
